imgcreate table `user`(
	`userNo` int not null,
	`email` varchar(50) not null,
	`name` varchar(10) not null,
	`password` varchar(10) not null,
	`delYn` char(1) not null
);

create table `like` (
	likeNo int not null,
	`count` int not null
);

create table board (
	boardNo int not null,
	userNo int not null,
	title varchar(30) not null,
	`contents` varchar(10000) not null,
	regDate varchar(20) not null,
	delYn char(1) not null default 'N'	
);

CREATE TABLE `teamlist` (
	`teamListNo` INT(11) NOT NULL AUTO_INCREMENT,
	`team_name` VARCHAR(20) NOT NULL,
	`team_nick` VARCHAR(40) NOT NULL,
	`team_code` VARCHAR(40) NOT NULL,
	`team_abbrev` VARCHAR(3) NOT NULL,
	`city` VARCHAR(20) NOT NULL,
	`state` VARCHAR(2) NULL DEFAULT NULL,
	`team_short_name` VARCHAR(40) NOT NULL,
	`team_id` INT(11) NOT NULL,
	`conference` VARCHAR(10) NOT NULL,
	`division_id` VARCHAR(15) NULL DEFAULT NULL,
	`emblems` LONGTEXT NULL DEFAULT NULL,
	`exist` VARCHAR(5) NOT NULL DEFAULT 'true',
	PRIMARY KEY (`teamListNo`),
	UNIQUE INDEX `인덱스 2` (`team_id`)
)
COLLATE='utf8_general_ci'
ENGINE=InnoDB
AUTO_INCREMENT=37
;





CREATE TABLE `player` (
	`playerListNo` INT(11) NOT NULL AUTO_INCREMENT,
	`firstName` VARCHAR(20) NOT NULL,
	`lastName` VARCHAR(20) NOT NULL,
	`personId` INT(11) NOT NULL,
	`team_id` INT(11) NULL DEFAULT NULL,
	`jersey` VARCHAR(5) NOT NULL DEFAULT 'N',
	`pos` VARCHAR(5) NOT NULL,
	`heightMeters` DOUBLE NULL DEFAULT NULL,
	`weightKilograms` INT(11) NULL DEFAULT NULL,
	`dateOfBirthUTC` VARCHAR(20) NULL DEFAULT NULL,
	`isActive` VARCHAR(5) NOT NULL DEFAULT 'true',
	PRIMARY KEY (`playerListNo`),
	INDEX `FK_player_teamlist` (`team_id`),
	CONSTRAINT `FK_player_teamlist` FOREIGN KEY (`team_id`) REFERENCES `teamlist` (`team_id`)
)
COLLATE='utf8_general_ci'
ENGINE=InnoDB
AUTO_INCREMENT=556
;




